import React, { useContext } from "react";
import { UserContext } from "../App";
import { useNavigate, Link, Outlet, NavLink } from "react-router-dom";
import {
    CDBSidebar,
    CDBSidebarContent,
    CDBSidebarFooter,
    CDBSidebarHeader,
    CDBSidebarMenu,
    CDBSidebarMenuItem,
} from 'cdbreact';

export default function ProfileDashboard() {

    const { setUser, setPwd } = useContext(UserContext);
    const navigate = useNavigate();

    const handleSignOut = () => {
        setUser('');
        setPwd('');
        navigate('/');
    }

    return (
        <div>
            <div className="d-flex">
                {/* <nav className="navbar fixed-left navbar-dark bg-dark profile-nav">
                    <ul>
                        <li>
                            <Link to="/profile/home">Home</Link>
                        </li>
                        <li>
                            <Link to="/profile/settings">Settings</Link>
                        </li>
                        <li>
                            <button className="btn btn-primary" onClick={(e) => handleSignOut()}>Log out</button>
                        </li>
                    </ul>
                </nav> */}
                <CDBSidebar textColor="#fff" backgroundColor="#333" className="profile-nav">
                    <CDBSidebarHeader prefix={<i className="fa fa-bars fa-large"></i>}>
                        <a href="/profile/home" className="text-decoration-none" style={{ color: 'inherit' }}>
                            Dashboard
                        </a>
                    </CDBSidebarHeader>
                    <CDBSidebarContent className="sidebar-content">
                        <CDBSidebarMenu>
                            <NavLink exact to="/profile/home" activeClassName="activeClicked">
                                <CDBSidebarMenuItem icon="columns">Home</CDBSidebarMenuItem>
                            </NavLink>
                            <NavLink exact to="/profile/settings" activeClassName="activeClicked">
                                <CDBSidebarMenuItem icon="table">Tables</CDBSidebarMenuItem>
                            </NavLink>
                        </CDBSidebarMenu>
                    </CDBSidebarContent>
                </CDBSidebar>

                <Outlet />
            </div>
        </div>
    )
}
